import styled from "styled-components";
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import PinterestIcon from '@mui/icons-material/Pinterest';
import PlaceIcon from '@mui/icons-material/Place';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';
import { mobile } from "../responsive";
import { Link } from "react-router-dom";
import { useTranslation } from "react-i18next";


const Container = styled.div`
    display: flex;
    ${mobile({ flexDirection: 'column'})};
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`;

const Logo = styled.h1`

`;

const Desc = styled.p`
    margin: 20px 0px;
`;

const SocialContainer = styled.div`
    display: flex;
`;

const SocialIcon = styled.div`
    width: 40px;
    height: 40px;
    border-radius: 50%;
    color: white;
    background-color: #${props => props.color};
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: 20px;
`;

const Center = styled.div`
    flex: 1;
    padding: 20px;
    ${mobile({ display: 'none'})};
`;

const Title = styled.h3`
    margin-bottom: 30px
`

const List = styled.ul`
    margin: 0;
    padding: 0;
    list-style: none;
    display: flex;
    flex-wrap: wrap;
`

const ListItem = styled.li`
    width: 50%;
    margin-bottom: 10px;
 `

const Right = styled.div`
    flex: 1;
    padding: 20px;
    ${mobile({ backgroundColor: '#fff8f8'})};
`;

const ContactItem = styled.div`
    margin-bottom: 20px;
    display: flex;
    align-items: center;
`;

const Payment = styled.img`
    width: 50%;
`

const Footer = () => {
    const { t } = useTranslation(["footer"]);

  return (
    <Container>
      <Left>
        <Logo>{t("logo")}</Logo>
        <Desc>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Itaque, iure numquam labore explicabo sapiente eaque quam iste praesentium. Voluptas consequuntur nam quod fugiat possimus enim non error hic tempore. Ullam!</Desc>
        <SocialContainer>
            <SocialIcon color='3B5999'>
                <FacebookIcon />
            </SocialIcon>
            <SocialIcon color='E4405F'>
                <InstagramIcon />
            </SocialIcon>
            <SocialIcon color='55ACEE'>
                <TwitterIcon />
            </SocialIcon>
            <SocialIcon color='E60023'>
                <PinterestIcon />
            </SocialIcon>
        </SocialContainer>
      </Left>
      <Center>
        <Title>Useful Links</Title>
        <List>
            <ListItem>
                <Link to="/" style={{ textDecoration: 'none', color: 'black' }}>
                    Home
                </Link>
            </ListItem>
            <ListItem>
                <Link to="/cart" style={{ textDecoration: 'none', color: 'black' }}>
                    Cart
                </Link>
            </ListItem>
            <ListItem>
                <Link to="/" style={{ textDecoration: 'none', color: 'black' }}>
                    Products
                </Link>
            </ListItem>
            <ListItem>My Account</ListItem>
            <ListItem>Order Tracking</ListItem>
            <ListItem>Wishlist</ListItem>
            <ListItem>Terms</ListItem>
        </List>
      </Center>
      <Right>
        <Title>Contact</Title>
        <ContactItem><PlaceIcon style={{ marginRight: '10px'}}/> Bilgorod-Dnistrovskiy district, village Delzhiler, Pushkina Str., 71</ContactItem>
        <ContactItem><PhoneIcon style={{ marginRight: '10px'}}/> +38 (096) 104 07 13</ContactItem>
        <ContactItem><EmailIcon style={{ marginRight: '10px'}}/> ivanzlatoff@gmail.com </ContactItem>
        <Payment src='https://i.ibb.co/Qfvn4z6/payment.png'/>
      </Right>
    </Container>
  )
}

export default Footer
